import React from 'react';
import logo from './logo.svg';
import './App.css';

function NavBarIcon(props) {
    return (
        <div 
            className={props.open ? 'navBarIcon open': "navBarIcon"} 
            onClick={props.onClick} >
            <div className="bar1"></div>
            <div className="bar2"></div>
            <div className="bar3"></div>
        </div>
    )
}

function NavBarTab(props) {
    return (
      <div className='navBarTab'
      onClick={props.onClick(props.tabName)}>
        <a href="#">{props.tabName}</a>
      </div>

    )
}

class NavBar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      open: false,
      navTabs: Array(2).fill(null),
    };
  }

  renderNavBarIcon() {
    return <NavBarIcon open={this.state.open} onClick={this.toggleClass.bind(this)}/>;
  }

  shouldComponentUpdate(nextState) {
    return this.state.open != nextState.open;
  }

  toggleClass() {
    const currentState = this.state.open;
    this.setState({ open: !currentState });
  };

  render() {
    return (
      <div className={this.state.open ? 'openedNavBar navBar': "navBar"}>
        <div className="navBarIcon">
          {this.renderNavBarIcon()}
        </div>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <div className="header">
        <h1>Scheduler</h1>
      </div>
      <NavBar/> 
    </div>
  );
}

export default App;
